    data: |
      SELECT DISTINCT + cor0.col0 * cor1.col0 AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0

outputs:
